children.value:
.box {
	--width: 100px;
	--height: 100px;
	position: absolute;
	width: var(--width);
	height: var(--height);
	left: calc(50% - var(--width) / 2);
	top: calc(50% - var(--height) / 2);
	border-radius: 4px;
	background-color: #ff3e00;
	cursor: move;
}

